{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/dayyak/cyclistic-rider-behavior-analysis?scriptVersionId=245316506\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"7d842e99","metadata":{"papermill":{"duration":0.010724,"end_time":"2025-06-13T21:11:17.659259","exception":false,"start_time":"2025-06-13T21:11:17.648535","status":"completed"},"tags":[]},"source":["# Introduction\n","Cyclistic is seeking to grow its business by increasing the number of annual memberships. Rather than focusing solely on digital campaigns to attract new users, the company believes that converting casual riders into loyal annual members offers a more sustainable path to success. To support this strategy, the analysis team has been tasked with answering the key question:\n","\n","**“How do casual riders and annual members behave differently?”**\n","\n","The objective is to uncover patterns, trends, and insights in rider behavior that can inform marketing, operational and membership strategies. This case-study presents data-driven findings along with actionable recommendations to help stakeholders make informed decisions aimed at boosting annual membership conversions."]},{"cell_type":"markdown","id":"c11942a2","metadata":{"papermill":{"duration":0.009907,"end_time":"2025-06-13T21:11:17.679285","exception":false,"start_time":"2025-06-13T21:11:17.669378","status":"completed"},"tags":[]},"source":["### Key Stakeholders\n"," - **Lily Moreno (marketing director):** Responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","\n"," - **Marketing analytics team:** Responsible for collecting, analyzing, and reporting data that helps guide Cyclistic's marketing strategy.\n","\n"," - **Cyclistic executive team:** Deciding whether to approve the recommended marketing program.\n","\n"," - **Riders:**\n","    * *Casual riders:* occasional users who pay per ride/daily (single-ride or ful-day passes).\n","\n","    * *Members:* regular users who pay a monthly or annual.(Cyclistic members)\n"]},{"cell_type":"markdown","id":"ec38cfed","metadata":{"papermill":{"duration":0.009824,"end_time":"2025-06-13T21:11:17.69907","exception":false,"start_time":"2025-06-13T21:11:17.689246","status":"completed"},"tags":[]},"source":["# Preperation Phase\n","**Data Source Description:**\n","The dataset consists of multiple .csv files covering the years 2019 and 2020, with one file provided for each quarter (Q1 to Q4). These files contain detailed trip-level data, including start and end times, station locations, user types, and ride durations. \n","\n","- Divvy_Trips_2019_Q1.csv\t\n","- Divvy_Trips_2019_Q2.csv\t\n","- Divvy_Trips_2019_Q3.csv\t\n","- Divvy_Trips_2019_Q4.csv\n","\n","- Divvy_Trips_2020_Q1.csv\t\n","- Divvy_Trips_2020_Q2.csv\t\n","- Divvy_Trips_2020_Q3.csv\n","- Divvy_Trips_2020_Q4.csv"]},{"cell_type":"code","execution_count":1,"id":"7cd6bc50","metadata":{"execution":{"iopub.execute_input":"2025-06-13T21:11:17.724072Z","iopub.status.busy":"2025-06-13T21:11:17.721477Z","iopub.status.idle":"2025-06-13T21:11:19.968954Z","shell.execute_reply":"2025-06-13T21:11:19.96708Z"},"papermill":{"duration":2.263396,"end_time":"2025-06-13T21:11:19.972237","exception":false,"start_time":"2025-06-13T21:11:17.708841","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.5\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.1\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.5.1     \u001b[