3T21:16:54.045657Z","iopub.status.idle":"2025-06-13T21:17:07.346774Z","shell.execute_reply":"2025-06-13T21:17:07.344874Z"},"papermill":{"duration":13.319132,"end_time":"2025-06-13T21:17:07.350562","exception":false,"start_time":"2025-06-13T21:16:54.03143","status":"completed"},"tags":[]},"outputs":[],"source":["# Create 4 new columns extracted from start time end time,  \n","# year, month name, day name, hour \n","for (year in 19:20) {\n","    df_name <- paste0(\"df_20\", year, \"_full\")\n","    df <- get(df_name)\n","    \n","    df <- df %>%\n","      mutate(\n","        start_year = year(start_time),\n","        start_month = format(start_time, \"%B\"),  # full month name\n","        start_day = format(start_time, \"%A\"),    # full weekday name\n","        start_hour = hour(start_time),\n","        \n","        end_year = year(end_time),\n","        end_month = format(end_time, \"%B\"),\n","        end_day = format(end_time, \"%A\"),\n","        end_hour = hour(end_time)\n","      )\n","    \n","    assign(df_name, df, envir = .GlobalEnv)\n","}\n"]},{"cell_type":"code","execution_count":26,"id":"29138816","metadata":{"execution":{"iopub.execute_input":"2025-06-13T21:17:07.378537Z","iopub.status.busy":"2025-06-13T21:17:07.376566Z","iopub.status.idle":"2025-06-13T21:17:10.345915Z","shell.execute_reply":"2025-06-13T21:17:10.344039Z"},"papermill":{"duration":2.986856,"end_time":"2025-06-13T21:17:10.349459","exception":false,"start_time":"2025-06-13T21:17:07.362603","status":"completed"},"tags":[]},"outputs":[],"source":["# Create Season Column\n","df_2019_full <- df_2019_full %>%\n","  mutate(\n","    month_num = match(start_month, month.name),  # Converts \"January\" to 1, etc.\n","    season = case_when(\n","      month_num %in% c(12, 1, 2) ~ \"Winter\",\n","      month_num %in% c(3, 4, 5) ~ \"Spring\",\n","      month_num %in% c(6, 7, 8) ~ \"Summer\",\n","      month_num %in% c(9, 10, 11) ~ \"Autumn\",\n","      TRUE ~ NA_character_\n","    )\n","  )\n","\n","df_2020_full <- df_2020_full %>%\n","  mutate(\n","    month_num = match(start_month, month.name),\n","    season = case_when(\n","      month_num %in% c(12, 1, 2) ~ \"Winter\",\n","      month_num %in% c(3, 4, 5) ~ \"Spring\",\n","      month_num %in% c(6, 7, 8) ~ \"Summer\",\n","      month_num %in% c(9, 10, 11) ~ \"Autumn\",\n","      TRUE ~ NA_character_\n","    )\n","  )\n"]},{"cell_type":"markdown","id":"84a79c0a","metadata":{"papermill":{"duration":0.012473,"end_time":"2025-06-13T21:17:10.373901","exception":false,"start_time":"2025-06-13T21:17:10.361428","status":"completed"},"tags":[]},"source":["## Processing Phase Summary\n","After conducting a thorough investigation to ensure data integrity, the following actions were taken to clean and prepare the dataset for further analysis:"]},{"cell_type":"code","execution_count":27,"id":"830d5ffb","metadata":{"execution":{"iopub.execute_input":"2025-06-13T21:17:10.403471Z","iopub.status.busy":"2025-06-13T21:17:10.401821Z","iopub.status.idle":"2025-06-13T21:17:10.440938Z","shell.execute_reply":"2025-06-13T21:17:10.438691Z"},"papermill":{"duration":0.056573,"end_time":"2025-06-13T21:17:10.444226","exception":false,"start_time":"2025-06-13T21:17:10.387653","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\n","Table: 2019 Processing Summary\n","\n","|Issue                           | Q1| Q2|  Q3| Q4|Action           |\n","|:-------------------------------|--:|--:|---:|--:|:----------------|\n","|Missing Values                  |  0|  0|   0|  0|Fixed (Filled)   |\n","|Duplicate Records               |  0|  0| 115|  0|Eliminated       |\n","|Logical error (s_time > e_time) |  0|  0|   0| 13|Fixed (Swapping) |\n","|Invalid Entries                 |  0|  0|   0|  0|Fixed (Filled)   |"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\n","Table: 2020 Processing Summary\n","\n","|Issue                           |  Q1|   Q2|     Q3|     Q4|Action           |\n","|:-------------