ultiple names due to formatting inconsistencies.\n","* Standardized user type values for consistency.\n","* Converted start_time and end_time columns to proper datetime format.\n","* Identified and removed records where start_time > end_time or start_time == end_time.\n","\n","**Data Engineering** \n","* Removed unnecessary columns to simplify the dataset.\n","* Created a trip_duration column by calculating the difference between start_time and end_time.\n","* Extracted new time-based features: year, month, day, and hour.\n","* Added a season column based on the month of each trip."]},{"cell_type":"markdown","id":"8b9c7503","metadata":{"papermill":{"duration":0.01284,"end_time":"2025-06-13T21:17:10.497924","exception":false,"start_time":"2025-06-13T21:17:10.485084","status":"completed"},"tags":[]},"source":["# Data Analysis Phase\n","Before analyzing the data, I take several important steps to ensure the dataset has a suitable structure. I organize the data in a tabular format, where each row represents a single observation, which is ideal for handling large datasets. Additionally, I ensure data type consistency by assigning appropriate formats to each variable, such as date, time, numeric, or string, depending on the nature of the data."]},{"cell_type":"code","execution_count":28,"id":"4cbf541f","metadata":{"execution":{"iopub.execute_input":"2025-06-13T21:17:10.526644Z","iopub.status.busy":"2025-06-13T21:17:10.524977Z","iopub.status.idle":"2025-06-13T21:17:15.471104Z","shell.execute_reply":"2025-06-13T21:17:15.469214Z"},"papermill":{"duration":4.962786,"end_time":"2025-06-13T21:17:15.473485","exception":false,"start_time":"2025-06-13T21:17:10.510699","status":"completed"},"tags":[]},"outputs":[],"source":["# Combine both years into one dataframe\n","df_full_year <- bind_rows(df_2019_full, df_2020_full)\n","\n","# Get unique years\n","years <- unique(df_full_year$start_year)"]},{"cell_type":"code","execution_count":29,"id":"ef2115fe","metadata":{"execution":{"iopub.execute_input":"2025-06-13T21:17:15.503637Z","iopub.status.busy":"2025-06-13T21:17:15.502006Z","iopub.status.idle":"2025-06-13T21:17:19.144887Z","shell.execute_reply":"2025-06-13T21:17:19.142703Z"},"papermill":{"duration":3.661623,"end_time":"2025-06-13T21:17:19.147152","exception":false,"start_time":"2025-06-13T21:17:15.485529","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\n","### Summary for 2019 \n","\n","Average Ride Length by User Type:\n","\n","|user_type | avg_ride_length|mode_day | max_ride|\n","|:---------|---------------:|:--------|--------:|\n","|Casual    |           56.53|Saturday |   177200|\n","|Member    |           13.84|Tuesday  |   150943|\n","\n","\n","Average Ride Length by User and Day of Week:\n","\n","|user_type | Friday| Monday| Saturday| Sunday| Thursday| Tuesday| Wednesday|\n","|:---------|------:|------:|--------:|------:|--------:|-------:|---------:|\n","|Casual    |  59.68|  54.01|    53.57|  55.69|    59.46|   56.92|     59.84|\n","|Member    |  13.41|  13.76|    15.81|  14.91|    13.29|   13.66|     13.32|\n","\n","\n","Count of Rides by User and Day of Week:\n","\n","|user_type | Friday| Monday| Saturday| Sunday| Thursday| Tuesday| Wednesday|\n","|:---------|------:|------:|--------:|------:|--------:|-------:|---------:|\n","|Casual    | 121141| 101489|   208056| 170179|   101359|   88655|     89745|\n","|Member    | 456966| 458780|   287163| 256241|   486816|  497022|    494277|\n","\n","--------------------------------------------\n","\n","### Summary for 2020 \n","\n","Average Ride Length by User Type:\n","\n","|user_type | avg_ride_length|mode_day | max_ride|\n","|:---------|---------------:|:--------|--------:|\n","|Casual    |           48.48|Saturday |   156450|\n","|Member    |           15.51|Friday   |    93793|\n","\n","\n","Average Ride Length by User and Day of Week:\n","\n","|user_type | Friday| Monday| Saturday| Sunday| Thursday| Tuesday| Wednesday|\n","|:---------|------:|------:|--------:|------:|--------:|-------:|---------:|\n","|Casual    |  46.36|  47.92|    49.18|  54.91|    47.87|   43.97|     43.97|\n","|Member    |  15.21|  14.70|    17.78|  18.13|    14.46|   14.26|     14.47|\n","\n","\n","Count of Rides by User and Day of Week:\n","\n","|user_type | Friday| Monday| Saturday| Sunday| Thursday| Tuesday| Wednesday|\n","|:---------|------:|------:|--------:|------:|--------:|-------:|---------:|\n","|Casual    | 185973| 128466|   293248| 238808|   147350|  124519|    137884|\n","|Member    | 296815| 264120|   282850| 244295|   295964|  283429|    296435|\n","\n","--------------------------------------------\n"]}],"source":["get_mode <- function(x) {\n","  uniqx <- unique(x)\n","  uniqx[which.max(tabulate(match(x, uniqx)))]\n","}\n","\n","for (yr in years) {\n","    df <- df_full_year %>% filter(start_year == yr)\n","    \n","    cat(\"\\n### Summary for\", yr, \"\\n\\n\")\n","    \n","    # Average ride length by user type\n","    avg_ride_by_user <- df %>%\n","      group_by(user_type) %>%\n","      summarise(avg_ride_length = mean(trip_duration, na.rm = TRUE), \n","                mode_day = get_mode(start_day),\n","                max_ride = max(trip_duration, na.rm = TRUE))\n","    cat(\"Average Ride Length by User Type:\")\n","    print(kable(avg_ride_by_user, digits = 2))\n","    \n","    # Average ride length by user type and day of week (wide)\n","    avg_ride_by_user_day <- df %>%\n","      group_by(user_type, start_day) %>%\n","      summarise(avg_ride_length = mean(trip_duration, na.rm = TRUE), .groups = \"drop\") %>%\n","      pivot_wider(names_from = start_day, values_from = avg_ride_length)\n","    cat(\"\\n\\nAverage Ride Length by User and Day of Week:\")\n","    print(kable(avg_ride_by_user_day, digits = 2))\n","    \n","    # Count of rides by user type and day of week (wide)\n","    ride_count_by_user_day <- df %>%\n","      group_by(user_type, start_day) %>%\n","      summarise(ride_count = n(), .groups = \"drop\") %>%\n","      pivot_wider(names_from = start_day, values_from = ride_count)\n","    cat(\"\\n\\nCount of Rides by User and Day of Week:\")\n","    print(kable(ride_count_by_user_day))\n","    \n","    cat(\"\\n--------------------------------------------\\n\")\n","}"]},{"cell_type":"markdown","id":"e4ad950f","metadata":{"papermill":{"duration":0.01227,"end_time":"2025-06-13T21:17:19.171708","exception":false,"start_time":"2025-06-13T21:17:19.159438","status":"completed"},"tags":[]},"source":["## Rider Behavior by Year and User Type\n","The **average ride length** for casual riders was about 57 minutes in 2019, dropping to nearly 50 minutes in 2020. For members, the average ride duration was around 14 minutes in 2019, increasing slightly to 16 minutes in 2020. In 2019, casual riders spent about four times longer riding compared to members; this ratio decreased to three times longer in 2020. These duration patterns likely reflect different usage purposes; casual riders probably use biking for leisure, sports, or to avoid traffic, benefiting from the flexibility and speed that bikes offer compared to buses or cars. In contrast, members tend to have shorter rides averaging around 15 minutes, suggesting their trips are primarily for commuting to work, university, or school. Supporting this, member ride counts are higher on weekdays than weekends, reflecting typical commuter patterns. In contrast, casual riders mostly ride during weekends, reinforcing the idea of leisure or recreational use.\n","\n","The **average ride length by user and day of the week** shows a clear distinction between casual riders and members. Casual riders consistently take longer trips, averaging between 43 and 55 minutes, with the longest rides occurring on Sundays. In contrast, members maintain much shorter and more consistent ride durations, typically between 14 and 18 minutes across all days. This suggests that casual users are more likely to use bikes for recreational purposes, especially on weekends, while members tend to use the service for shorter, utilitarian trips such as commuting.\n","\n","The **ride count by user and day of the week** highlights differences in riding patterns. Casual riders take significantly more rides on weekends, peaking on Saturdays and Sundays, indicating a preference for leisure riding during non-working days. On the other hand, members maintain high ride volumes throughout the entire week, with particularly strong usage on weekdays such as Wednesday and Friday. This pattern supports the idea that members use the service as part of their daily routine, likely for commuting or regular errands.\n","\n","  "]},{"cell_type":"code","execution_count":30,"id":"91fd2159","metadata":{"execution":{"iopub.execute_input":"2025-06-13T21:17:19.200297Z","iopub.status.busy":"2025-06-13T21:17:19.198679Z","iopub.status.idle":"2025-06-13T21:17:26.816736Z","shell.execute_reply":"2025-06-13T21:17:26.814565Z"},"papermill":{"duration":7.635328,"end_time":"2025-06-13T21:17:26.819423","exception":false,"start_time":"2025-06-13T21:17:19.184095","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAALQCAIAAAAYVqTpAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AUVdfA8TPb0htJgNB7RxGkCSgiKIIFUQFBwQIqvkgXEMSGoCBSFRuoKAI2\nmog8IiLSEQXpSgkIhBYSUjbJ1nk/bAwh2RSS3eyQ/H8fdDJzZ+6ZnV1ycvbOXEVVVQEAAAAA\nAACgDTpfBwAAAAAAAADgCgp2AAAAAAAAgIZQsAMAAAAAAAA0hIIdAAAAAAAAoCEU7AAAAAAA\nAAANoWAHAAAAAAAAaAgFOwAAAAAAAEBDKNgBAAAAAAAAGkLBDgAAX5rcoJzynxH7Lvk6HDfS\nLi5W8mX0D65QuXbH7r2mzF+VYHfmPoKrWYMnthS+0yMLb3Xttdts89ypXLHliQau44+OTfLG\n8bWgc0SAoigVblpdzOOc33GP67VafDHNI4EV3rGvOrq67vjVsfxbZr1LoxuvKJnYiixu4935\nf6DcOpxu93XgAACgRFGwAwDAZ6zJW1/753LWj9+O3ODDYIrMbjFfiDu+cc03EwbdX7P+nT+e\nMfs6ojIkJXbNggULFixYcMHmplQKAACA65TB1wEAAFB2HV042qaqWT+e/W3oRVvPaKNGv04L\njH545DP1c65VHWmpl4/v37Fmw26rU00+vv7BZvedOrsu0qDRsyhlLuycNnDgRhHZ2uux8kaT\nr8NBwUKqP/LSSzfnWKk6Uie/OUtETCE3jxnWNfdeUXygAAAoYyjYAQDgM1Mn7xURnT54+p0R\nI3885bCeHbbl3OKOlXwdl3uB0X0