,"  # Average ride length by user and day\n","  avg_ride_by_user_day <- df %>%\n","    group_by(user_type, start_day) %>%\n","    summarise(avg_ride_length = mean(trip_duration, na.rm = TRUE), .groups = \"drop\")\n","  \n","  p2 <- ggplot(avg_ride_by_user_day, aes(x = start_day, y = avg_ride_length, fill = user_type)) +\n","    geom_col(position = \"dodge\") +\n","    scale_x_discrete(labels = function(x) str_sub(x, 1, 1)) +\n","    labs(title = paste(yr),\n","         x = \"Day of Week\", y = \"Avg Ride Length (min)\") +\n","    theme_minimal()\n","  plots_avg_user_day[[as.character(yr)]] <- p2\n","  \n","  # Count of rides by user and day\n","  ride_count_by_user_day <- df %>%\n","    group_by(user_type, start_day) %>%\n","    summarise(ride_count = n(), .groups = \"drop\")\n","  \n","  p3 <- ggplot(ride_count_by_user_day, aes(x = start_day, y = ride_count, fill = user_type)) +\n","    geom_col(position = \"dodge\") +\n","    scale_x_discrete(labels = function(x) str_sub(x, 1, 1)) +\n","    labs(title = paste(yr),\n","         x = \"Day of Week\", y = \"Number of Rides\") +\n","    theme_minimal()\n","  plots_count_user_day[[as.character(yr)]] <- p3\n","}\n","\n","options(repr.plot.width = 14, repr.plot.height = 6)\n","# Display plots side-by-side for each summary type\n","wrap_plots(plots_avg_user, nrow = 1) + \n","  plot_annotation(title = \"Avg Ride Length by User Type\") &\n","  theme(\n","    plot.title = element_text(size = 18, hjust = 0.5),\n","    axis.title.x = element_text(size = 18),  \n","    axis.title.y = element_text(size = 18),\n","    axis.text.x = element_text(size = 16),\n","    axis.text.y = element_text(size = 16)\n","  )\n","wrap_plots(plots_avg_user_day, nrow = 1) + \n","  plot_annotation(title = \"Avg Ride Length by User & Day\") &\n","  theme(\n","    plot.title = element_text(size = 18, hjust = 0.5),\n","    axis.title.x = element_text(size = 18),  \n","    axis.title.y = element_text(size = 18),\n","    axis.text.x = element_text(size = 