"  geom_col(position = \"dodge\") +\n","  facet_wrap(~day_type) +\n","  labs(title = \"Average Ride Length by User, Day Type and Season (2020)\",\n","       x = \"Season\", y = \"Avg Ride Length (min)\") +\n","  theme_minimal()\n","\n","# Plot 3: Ride count by user, day type, and season\n","ride_count_by_user_daytype_season <- df_2020 %>%\n","  group_by(user_type, day_type, season) %>%\n","  summarise(ride_count = n(), .groups = \"drop\")\n","\n","p3 <- ggplot(ride_count_by_user_daytype_season, aes(x = season, y = ride_count, fill = user_type)) +\n","  geom_col(position = \"dodge\") +\n","  facet_wrap(~day_type) +\n","  labs(title = \"Ride Count by User, Day Type and Season (2020)\",\n","       x = \"Season\", y = \"Number of Rides\") +\n","  theme_minimal()\n","\n","# Example: increasing font sizes for plot 1\n","p1 <- p1 + theme(\n","  plot.title = element_text(size = 20, hjust = 0.5),\n","  axis.title.x = element_text(size = 16),\n","  axis.title.y = element_text(size = 16),\n","  axis.text.x = element_text(size = 14),\n","  axis.text.y = element_text(size = 14)\n",")\n","\n","# Similarly for plot 2\n","p2 <- p2 + theme(\n","  plot.title = element_text(size = 20, hjust = 0.5),\n","  axis.title.x = element_text(size = 16),\n","  axis.title.y = element_text(size = 16),\n","  axis.text.x = element_text(size = 14),\n","  axis.text.y = element_text(size = 14),\n","  strip.text = element_text(size = 16)  # facet labels\n",")\n","\n","# And plot 3\n","p3 <- p3 + theme(\n","  plot.title = element_text(size = 20, hjust = 0.5),\n","  axis.title.x = element_text(size = 16),\n","  axis.title.y = element_text(size = 16),\n","  axis.text.x = element_text(size = 14),\n","  axis.text.y = element_text(size = 14),\n","  strip.text = element_text(size = 16)  # facet labels\n",")\n","\n","# Display plots\n","p1\n","p2\n","p3\n"]},{"cell_type":"code","execution_count":33,"id":"8411143a","metadata":{"execution":{"iopub.execute_input":"2025-06-13T21:17:34.12308Z","iopub.status.busy":"2