9Lftob8d\naecWHPgyScYQBwAAAHQQLiMAAACgZ8SNGJfotDiTss65+v5lOz7F6AYAAAB0BmZwAAAAAAAA\nAECvh59KAAAAAAAAAKDXwwAHAAAAAAAAAPR6GOAAAAAAAAAAgF4PAxwAAAAAAAAA0OthgAMA\nAAAAAAAAej0McAAAAAAAAABAr4cBDgAAAAAAAADo9TDAAQAAAAAAAAC9HgY4AAAAAAAAAKDX\n+38CMgDQCQCHKAAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":720,"width":720}},"output_type":"display_data"}],"source":["# Prepare the data: add hour, season, and day_type columns\n","df_2020 <- df_2020 %>%\n","  mutate(\n","    user_type = factor(user_type, levels = c(\"Casual\", \"Member\")),\n","    day_type = if_else(start_day %in% c(\"Saturday\", \"Sunday\"), \"Weekend\", \"Weekday\"),\n","    day_type = factor(day_type, levels = c(\"Weekday\", \"Weekend\"))\n","  )\n","\n","# Aggregate by season, day_type, hour, user_type\n","agg_data <- df_2020 %>%\n","  group_by(season, day_type, start_hour, user_type) %>%\n","  summarise(\n","    avg_duration = mean(trip_duration, na.rm = TRUE),\n","    ride_count = n(),\n","    .groups = \"drop\"\n","  )\n","\n","# Plot\n","options(repr.plot.width = 12, repr.plot.height = 12)\n","\n","ggplot(agg_data, aes(x = start_hour, y = ride_count, color = user_type, size = avg_duration)) +\n","  geom_point(alpha = 0.7) +\n","  facet_grid(season ~ day_type) +        # Seasons in rows, Weekday/Weekend in columns\n","  scale_x_continuous(breaks = 0:23) +\n","  labs(\n","    title = \"Ride Count and Average Duration Distribution by Hour, Season, and Day Type (2020)\",\n","    x = \"Hour of Day\",\n","    y = \"Ride Count\",\n","    color = \"User Type\",\n","    size = \"Duration Avg\"\n","  ) +\n","  theme_minimal() +\n","  theme(\n","    plot.title = element_text(size = 20, face = \"bold\"),\n","    axis.title.x = element_text(size = 16),\n","    axis.title.y = element_text(size = 16),\n","    axis.text.x = element_text(size = 10, angle = 45, hjust = 1),\n","    axis.text.y = element_text(size = 10),\n","    legend.title = element_text(size = 12),\n","    legend.text = element_text(size = 10),\n","  